import React from 'react'

const Home = () => {
  return (
    // <div className='font-bold'>Home</div>
    <section id='home' className='h-screen w-screen text-gray-500 relative scrolls-smooth overflow-x-hidden   '>
        <div className='absolute top-0 left-0 h-full w-full z-[1]'>
            <backgroundImage src="./assets/coffee_images/bg.jpg" alt="background" />
        </div>
    </section>
  )
}

export default Home
